import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";

const definePreco = (items) => {
  let valor = 0;
  for (let index = 0; index < items.length; index++) {
    valor += items[index].valor * items[index].quant;
  }
  return valor.toFixed(2);
};

function GerarPDF(name, dateSale, formaPagamento, vendaList) {
  pdfMake.vfs = pdfFonts.pdfMake.vfs;

  const dados = vendaList.items.map((produto) => {
    return [
      {
        text: produto.name,
        fontSize: 9,
        margin: [0, 2, 0, 2],
      },
      {
        text: produto.quant,
        fontSize: 9,
        margin: [0, 2, 0, 2],
      },
      {
        text: produto.valor.toFixed(2),
        fontSize: 9,
        margin: [0, 2, 0, 2],
      },
      {
        text: (produto.valor * produto.quant).toFixed(2),
        fontSize: 9,
        margin: [0, 2, 0, 2],
      },
    ];
  });

  const details = {
    content: [
      {
        margin: [0, 0, 0, 0],
        image:
          "data:image/png;base64,",

        width: 30,
      },
      {
        table: {
          headerRows: 1,
          widths: ["*"],
          body: [
            [
              {
                text: `Geraldo Henrique - Data: ${dateSale}`,
                style: "tableHeader",
                alignment: "center",
                bold: true,
                fontSize: 13,
                margin: [0, 0, 0, 20],
              },
            ],
            [
              {
                text: "",
                fontSize: 9,
                margin: [0, 2, 0, 2],
              },
            ],
          ],
        },
        layout: "lightHorizontalLines",
      },
      {
        text: `Cliente: ${name} / Pagamento: ${formaPagamento}`,
        fontSize: 13,
        bold: true,
        margin: [0, 20, 0, 30],
      },
      {
        table: {
          headerRows: 1,
          widths: ["*", "*", "*", "*"],
          body: [
            [
              {
                text: "Produto",
                style: "tableHeader",
                fontSize: 10,
              },
              {
                text: "Quantidade",
                style: "tableHeader",
                fontSize: 10,
              },
              {
                text: "Preço Unitário",
                style: "tableHeader",
                fontSize: 10,
              },
              {
                text: "Preço Total",
                style: "tableHeader",
                fontSize: 10,
              },
            ],
            ...dados,
            [
              {
                text: "",
                fontSize: 9,
                margin: [0, 2, 0, 2],
              },
              {
                text: "",
                fontSize: 9,
                margin: [0, 2, 0, 2],
              },
              {
                text: "Valor total:",
                fontSize: 9,
                bold: true,
                margin: [0, 2, 0, 2],
              },
              {
                text: `${definePreco(vendaList.items)}`,
                bold: true,
                fontSize: 9,
                margin: [0, 2, 0, 2],
              },
            ],
          ],
        },
        layout: "lightHorizontalLines",
      },
      {
        image:
          "data:image/png;base64,",
        width: "500",
        margin: [30, 100, 0, 0],
      },
    ],
  };

  function Rodape(currentPage, pageCount) {
    return [
      {
        text: `${currentPage}/${pageCount}`,
        alignment: "right",
        fontSize: 9,
        margin: [0, 10, 20, 0],
      },
    ];
  }

  const docDefine = {
    pageSize: "A4",
    pageMargins: [15, 10, 15, 40],

    header: [],
    content: [details.content],
    footer: Rodape,
  };

  pdfMake.createPdf(docDefine).open();
}

export default GerarPDF;
